	add("guard", "{\"term\":\"guard\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"For verb: From early Middle french (ca. 1400-1600) or late Old french (842-ca. 1400) (circa 14th cent) \u0027guarder\u0027 (to keep, ward, guard, save, preserve, etc.) from Frankish \u0027*wardōn\u0027, from Proto-germanic \u0027*wardo-\u0027. Cognate with Old english (ca. 450-1100) \u0027weardian\u0027 (from which English \u0027to ward\u0027). Compare French \u0027garder\u0027 See also English \u0027regard\u0027.For noun: From Middle english (1100-1500) \u0027garde\u0027 from early Middle french (ca. 1400-1600) or late Old french (842-ca. 1400) \u0027guarde\u0027 (a guardian, warden, keeper) (whence modern French \u0027garde\u0027 , from the verb \u0027guarder\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who, or thing that, protects or watches over something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d2|passage\u003dSunning himself on the board steps, I saw for the first time Mr. Farquhar Fenelon Cooke.A silver snaffle on a heavy leather watch \u0027\u0027guard\u0027\u0027 which connected the pockets of his corduroy waistcoat, together with a huge gold stirrup in his Ascot tie, sufficiently proclaimed his tastes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A squad responsible for protecting something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A part of a machine which blocks access to dangerous parts\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A panel of a car that encloses the wheel area, especially the front wheels\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A relatively short player, playing farther from the basket than a forward or center\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The position on the popping crease where a batsman makes a mark to align himself with the wicket; \u0027see take guard\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Either of two offensive positions between the center and each of the offensive tackles, whose main responsibilities are to protect the quarterback, and open up \u0026quot;holes\u0026quot; through which offensive players can run\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A player playing a position named guard\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An employee, normally travelling in the last vehicle of a train, responsible for the safety of the train\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A Boolean expression that must evaluate to true for a branch of program execution to continue\", \"priority\":11}]}, \"synonyms\":{}}");

