	add("guaranty", "{\"term\":\"guaranty\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\", \"frankish\", \"old french (842-ca. 1400)\", \"middle low german\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027guarantie\u0027 from Old french (842-ca. 1400) \u0027guarantie\u0027 (protection, defense) from Old french (842-ca. 1400) \u0027garantir\u0027 \u0027guarantir\u0027 (to warrant, vouch for something) from Old french (842-ca. 1400) \u0027garant\u0027 \u0027guarant\u0027 \u0027warant\u0027 (a warrant; warranter, supporter, defender, protector) from Frankish {{m|frk|*warand}}, {{m|frk|*warjand||a warrant}}, from Frankish {{m|frk|*warjan||to fend for, designate something as true, vouch for}}, from Proto-germanic {{m|gem-pro|*warjaną||to defend, protect}}, from Proto-indo-european {{m|ine-pro|*wer-||to close, cover, protect, save, defend}}. Cognate with Middle low german \u0027warent\u0027 \u0027warend\u0027 (a warrant) German \u0027gewähren\u0027 (to grant) More at {{l|en|warrant}}. Compare \u0027guarantee\u0027 \u0027warranty\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An undertaking to answer for the payment of some debt, or the performance of some contract or duty, of another, in case of the failure of such other to pay or perform; a warranty; a security\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something serving as a security for such an undertaking\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An assurance or guarantee\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1945\u0027\u0027, “[http://www.jstor.org/stable/2988964 The Philosophical Basis of Masaryk’s Political Ideals]” in \u0027w:Ethics Ethics\u0027 LV, № 4 (July 1945), page 299, right column\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The concept of God and immortality is for him a \u0027\u0027guaranty\u0027\u0027 of this eternal difference between right and wrong\", \"priority\":5}]}, \"synonyms\":{}}");

