	add("guardianship", "{\"term\":\"guardianship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|guardian|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The office or position of one acting as a guardian or conservator, especially in a legal capacity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027 Philip Bean, \u0026quot;Mental Disorder and Legal Control\u0026quot; - Page 8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An application for \u0027\u0027guardianship\u0027\u0027 must be founded on two medical recommendations, the procedure being similar to an application for admission for treatment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Forbidden to you are your mothers and your daughters and your sisters and your paternal aunts and your maternal aunts and brothers\u0027 daughters and sisters\u0027 daughters and your mothers that have suckled you and your foster-sisters and mothers of your wives and your step-daughters who are in your \u0027\u0027guardianship\u0027\u0027, (born) of your wives to whom you have gone in, but if you have not gone in to them, there is no blame on you (in marrying them), and the wives of your sons who are of your own loins and that you should have two sisters together, except what has already passed; surely Allah is Forgiving, Merciful.\u0027 Qur\u0027an, \u0027The Women\u0027, 4.23 (M.H. Shakir translation\", \"priority\":4}]}, \"synonyms\":{}}");

